import accountRegisterRoute from './accountRegisterRoute';
import authenticateRoute from './authenticateRoute';
import dashboardRoute from './dashboardRoute';
import profileRoute from './profileRoute';
import sharedRoute from './sharedRoute';
import sitesRoute from './sitesRoute';

let route = [
	accountRegisterRoute,
	authenticateRoute,
	dashboardRoute,
	profileRoute,
	sitesRoute,
	sharedRoute,
];

route = route.flat();

export default route;
